window.CUCUMBER_MESSAGES = [{"meta":{"protocolVersion":"24.1.0","implementation":{"name":"cucumber-jvm","version":"7.18.1"},"runtime":{"name":"OpenJDK 64-Bit Server VM","version":"23-valhalla+1-90"},"os":{"name":"Windows 11"},"cpu":{"name":"amd64"}}},{"testRunStarted":{"timestamp":{"seconds":1760876256,"nanos":652506200}}},{"source":{"uri":"classpath:uo\/ri\/cws\/application\/service\/contract\/Add.feature","data":"Feature: [C.A] Add a contract for a mechanic\n  As a Manager\n  I want to hire a mechanic\n\n  Scenario Outline: [C.A.1] Hire an existing mechanic with no previous contract in force\n    Given [C.A.1] a mechanic with no contract\n    When [C.A.1] I hire that mechanic with an annual <salary>\n    Then [C.A.1] a contract in force for that mechanic is created\n      And [C.A.1] start date is first day next month\n    Examples:\n        | salary   |\n        | 12000.0  |\n        | 18000.0  |\n        | 24000.0  |\n        | 30000.0  |\n        | 36000.0  |\n        | 60000.0  |\n        | 90000.0  |\n        | 320000.0 |\n\n  Scenario: [C.A.2] Hire an existing mechanic with a previous contract in force shorter than a year\n    Given [C.A.2] an already less-than-a-year hired mechanic\n    When [C.A.2] I create a new contract for that mechanic\n    Then [C.A.2] there is a new contract in force for that mechanic\n      And [C.A.2] previous contract is terminated with no settlement\n\n  Scenario: [C.A.3] Hire an existing mechanic with previous contract terminated\n    Given [C.A.3] a mechanic with a previous contract terminated\n    When [C.A.3] I hire that mechanic\n    Then [C.A.3] a contract in force for that mechanic is created\n\n  Scenario: [C.A.4] Try to add a contract for a non existing mechanic\n    When [C.A.4] I try to hire a non existent mechanic\n    Then [C.A.4] a business error happens with an explaining message\n\n  Scenario: [C.A.5] Try to add a contract for a non existing contract type\n    When [C.A.5] I try to hire a mechanic with non existent contract type\n    Then [C.A.5] a business error happens with an explaining message\n\n  Scenario: [C.A.6] Try to add a contract for a non existing professional group\n    When [C.A.6] I try to hire a mechanic with non existent professional group\n    Then [C.A.6] a business error happens with an explaining message\n\n  Scenario: [C.A.7] Try to add a contract with end date earlier than start date\n    When [C.A.7] I try to add a contract with end date not later than start date\n    Then [C.A.7] a business error happens with an explaining message\n\n  Scenario: [C.A.8] Try to add a null contract\n    When [C.A.8] I try to add a null argument\n    Then [C.A.8] argument is rejected with an explaining message\n\n  Scenario: [C.A.11] Try to add a contract with null end date when mandatory\n    When [C.A.11] I try to add a contract with null end date for FIXED_TERM contract type\n    Then [C.A.11] argument is rejected with an explaining message\n\n  Scenario Outline: [C.A.12] Try to add a contract with wrong nif\n    When [C.A.12] I try to add a contract with wrong nif <nif>\n    Then [C.A.12] argument is rejected with an explaining message\n    Examples:\n      | nif    |\n      | \"null\" |\n      | \"   \"  |\n      | \"\"     |\n\n  Scenario Outline: [C.A.13] Try to add a contract with wrong values\n    When [C.A.13] I try to add a contract with wrong fields <type> <profGroup> <annualWage>\n    Then [C.A.13] argument is rejected with an explaining message\n    Examples:\n      | type        | profGroup | annualWage |\n      | \"   \"       | \"I\"       | 1000.0     |\n      | \"\"          | \"I\"       | 1000.0     |\n      | \"PERMANENT\" | \" \"       | 1000.0     |\n      | \"PERMANENT\" | \"\"        | 1000.0     |\n      | \"PERMANENT\" | \"I\"       | 0.0        |\n      | \"PERMANENT\" | \"I\"       | -1000.0    |","mediaType":"text\/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"classpath:uo\/ri\/cws\/application\/service\/contract\/Add.feature","f h payrolls\n    When [C.D.2] I try to delete that contract\n    Then [C.D.2] a business error happens with an explaining message\n      \n  Scenario: [C.D.3] Try to delete a contract for a mechanic with interventions during the contract\n    Given [C.D.3] a contract for a mechanic with interventions during the contract\n    When [C.D.3] I try to delete that contract\n    Then [C.D.3] a business error happens with an explaining message \n\n  Scenario: [C.D.4] Try to delete a non existing contract\n    When [C.D.4] I try to delete a non existing contract\n    Then [C.D.4] a business error happens with an explaining message\n            \n  Scenario: [C.D.5] Try to delete a null contract id\n    When [C.D.5] I try to delete a null contract id\n    Then [C.D.5] argument is rejected with an explaining message","mediaType":"text\/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"classpath:uo\/ri\/cws\/application\/service\/contract\/Delete.feature","feature":{"location":{"line":1,"column":1},"tags":[],"language":"en","keyword":"Feature","name":"[C.D] Delete a contract","description":"  As a Manager\n  I want to delete a contract (I wrote sth wrong and I want to delete it and then try to do it right)","children":[{"scenario":{"location":{"line":5,"column":3},"tags":[],"keyword":"Scenario","name":"[C.D.1] Delete a contract","description":"","steps":[{"location":{"line":6,"column":5},"keyword":"Given ","keywordType":"Context","text":"[C.D.1] a contract for a mechanic with no payrolls neither interventions","id":"dd3587c7-752e-4629-a3fc-9ecc15de774d"},{"location":{"line":7,"column":5},"keyword":"When ","keywordType":"Action","text":"[C.D.1] I delete the contract for the mechanic","id":"ddd7157c-16d9-499f-9ba3-2bfa581c31ed"},{"location":{"line":8,"column":5},"keyword":"Then ","keywordType":"Outcome","text":"[C.D.1] This contract does not exist any more","id":"43a5aa88-92f3-4446-b175-91134f287583"}],"examples":[],"id":"f3f455d8-6241-4c09-a7a4-4604e58ee032"}},{"scenario":{" t is found\n\n  Scenario: [C.F.5] Find by id a non existent contract\n    When [C.F.5] I search a non existing contract id\n    Then [C.F.5] nothing is found\n\n  Scenario: [C.F.6] Try to find a contract with null id\n    When [C.F.6] I try to find a contract with null id\n    Then [C.F.6] argument is rejected with an explaining message\n\n  Scenario: [C.F.7] Try to find a contract for a mechanic with null arg\n    When [C.F.7] I try to find a contract for a mechanic with null id\n    Then [C.F.7] argument is rejected with an explaining message\n\n  # Find contracts by mechanic id\n  Scenario: [C.F.8] Find contracts by mechanic id for a non existent mechanic\n    When [C.F.8] I search contracts for a non existent mechanic\n    Then [C.F.8] List of contracts summary is empty\n\n  Scenario: [C.F.9] Find contracts by mechanic id for an existent mechanic with no contracts\n    Given [C.F.9] a mechanic with no contracts\n    When [C.F.9] I search contracts for that mechanic\n    Then [C.F.9] List of contracts summary is empty\n\n  Scenario: [C.F.10] Find contracts by mechanic ID for an existing mechanic with no active contracts and several terminated contracts with no payrolls.\n    Given [C.F.10] a mechanic with several contracts terminated\n    When [C.F.10] I search contracts for that mechanic\n    Then [C.F.10] All contract summaries are found\n\n  Scenario: [C.F.11] Find contracts by mechanic ID for an existing mechanic with one active contract and several payrolls.\n    Given [C.F.11] a mechanic with one in-force contract and several payrolls\n    When [C.F.11] I search contracts for that mechanic\n    Then [C.F.11] All contract summaries are found\n\n  Scenario: [C.F.12] Find contracts by mechanic id for an existent mechanic with several contracts terminated and one contract in force with several payrolls\n    Given [C.F.12] a mechanic with several contracts terminated and one in force all with payrolls\n    When [C.F.12] I search contracts for that mechanic\n "uri":"classpath:uo\/ri\/cws\/application\/service\/contract\/Update.feature","data":"Feature: [C.U] Update a contract\n  As a manager \n  I want to update some fields of a contract\n\n  Scenario: [C.U.1] Update end date\n    Given [C.U.1] an in-force fixed-term contract\n    When [C.U.1] I update the end date of the contract\n    Then [C.U.1] the end date is updated\n\n  Scenario: [C.U.2] Update salary\n    Given [C.U.2] an in-force contract\n    When [C.U.2] I update the salary of the contract\n    Then [C.U.2] the salary is updated\n\n  Scenario: [C.U.3] Try to update a non existing contract  \n    When [C.U.3] I try to update a non existing contract\n    Then [C.U.3] a business error happens with an explaining message\n\n  Scenario: [C.U.4] Try to update a contract terminated\n    Given [C.U.4] a terminated contract\n    When [C.U.4] I try to update that terminated contract\n    Then [C.U.4] a business error happens with an explaining message\n\n  Scenario: [C.U.5] Try to update a contract with wrong end date\n    Given [C.U.5] an in-force fixed-term contract\n    When [C.U.5] I try to update that with end date earlier than start date\n    Then [C.U.5] a business error happens with an explaining message\n\n  Scenario: [C.U.6] Try to update a contract in the while (wrong version)\n    Given [C.U.6] an in-force contract\n    When [C.U.6] I try to update a contract updated in the while\n    Then [C.U.6] a business error happens with an explaining message\n\n  Scenario: [C.U.7] Try to update a null contract\n    When [C.U.7] I try to update a null contract\n    Then [C.U.7] argument is rejected with an explaining message\n\n  Scenario: [C.U.8] Try to update a contract with null id\n    When [C.U.8] I try to update a contract with null id\n    Then [C.U.8] argument is rejected with an explaining message\n\n  Scenario Outline: [C.U.9] Try to update a contract with wrong id\n    When [C.U.9] I try to update a contract with id <ident>\n    Then [C.U.9] argument is rejected with an explaining message\n    Examples: \n      | ident  |\n      | \"null\" |\n      | \"  \"   |\n      | \"\"     |\n\n  Scenario Outline: [C.U.10] Try to update a contract with wrong salary\n    Given [C.U.10] an in-force contract\n    When [C.U.10] I try to update a contract with wrong salary <money>\n    Then [C.U.10] argument is rejected with an explaining message\n    Examples: \n      | money  |\n      |    0.0 |\n      | -100.0 |","mediaType":"text\/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"classpath:uo\/ri\/cws\/application\/service\/contract\/Update.feature","feature":{"location":{"line":1,"column":1},"tags":[],"language":"en","keyword":"Feature","name":"[C.U] Update a contract","description":"  As a manager \n  I want to update some fields of a contract","children":[{"scenario":{"location":{"line":5,"column":3},"tags":[],"keyword":"Scenario","name":"[C.U.1] Update end date","description":"","steps":[{"location":{"line":6,"column":5},"keyword":"Given ","keywordType":"Context","text":"[C.U.1] an in-force fixed-term contract","id":"2409a3e2-8c30-4021-9570-4e8a3b1ce37f"},{"location":{"line":7,"column":5},"keyword":"When ","keywordType":"Action","text":"[C.U.1] I update the end date of the contract","id":"80fd5e8d-cbf5-4e00-aec4-794f2322fd8b"},{"location":{"line":8,"column":5},"keyword":"Then ","keywordType":"Outcome","text":"[C.U.1] the end date is updated","id":"341d9fc1-8c98-422c-8484-e82bdaa77a4b"}],"examples":[],"id":"7f1f91ed-7f2f-4c47-bea7-60eda37d0058"}},{"scenario":{"location":{"line":10,"column":3},"tags":[],"keyword":"Scenario","name":"[C.U.2] Update salary","description":"","steps":[{"location":{"line":11,"column":5},"keyword":"Given ","keywordType":"Context","text":"[C.U.2] an in-force contract","id":"94502946-1cd7-4b27-94a5-f26a2c4545a4"},{"location":{"line":12,"column":5},"keyword":"When ","keywordType":"Action","text":"[C.U.2] I update the salary of the contract","id":"0965278c-063d-424c-98c7-e838b7262b8e"},{"location":{"li pplication\/service\/contracttype\/AddContractType.feature","data":"Feature: [Ct.A] Add a new contract type\n  As a Manager\n  I want to add a contract type group due to changes in labour laws\n\n  Scenario: [Ct.A.1] Add a new contract type\n    When [Ct.A.1] I register a new contract type\n    Then [Ct.A.1] The contract type is added\n\n  Scenario: [Ct.A.2] Try to add a repeated contract type\n    Given [Ct.A.2] a registered contract type\n    When [Ct.A.2] I try to add another contract type with the same name\n    Then [Ct.A.2] a business error happens with an explaining message\n\n  Scenario: [Ct.A.3] Try to add a contract type with null arg\n    When [Ct.A.3] I try to add a contract type with null argument\n    Then [Ct.A.3] argument is rejected with an explaining message\n\n  Scenario: [Ct.A.4] Try to add a contract type with null name\n    When [Ct.A.4] I try to add a contract type with null name\n    Then [Ct.A.4] argument is rejected with an explaining message\n\n  Scenario: [Ct.A.5] Try to add a contract type with negative compensation days\n    When [Ct.A.5] I try to add a contract type with negative compensation days\n    Then [Ct.A.5] argument is rejected with an explaining message\n\n  Scenario Outline: [Ct.A.6] Try to add a contract type with empty name\n    When [Ct.A.6] I try to add a contract type with <name>\n    Then [Ct.A.6] argument is rejected with an explaining message\n    Examples:\n      | name   |\n      | \"null\" |\n      | \"\"     |\n      | \"   \"  |","mediaType":"text\/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"classpath:uo\/ri\/cws\/application\/service\/contracttype\/AddContractType.feature","feature":{"location":{"line":1,"column":1},"tags":[],"language":"en","keyword":"Feature","name":"[Ct.A] Add a new contract type","description":"  As a Manager\n  I want to add a contract type group due to changes in labour laws","children":[{"scenario":{"location":{"line":5,"column":3},"tags":[],"keyword":"Scenario","name":"[Ct.A. SSED"},"timestamp":{"seconds":1760876263,"nanos":553162500}}},{"testCaseFinished":{"testCaseStartedId":"ddd3f9bc-eefb-4cfa-8a66-11ef1918b184","timestamp":{"seconds":1760876263,"nanos":553162500},"willBeRetried":false}},{"source":{"uri":"classpath:uo\/ri\/cws\/application\/service\/invoice\/CreateInvoiceFor.feature","data":"Feature: [I.C] Create one invoice for one or multiple jobs\n  As a Cashier\n  I want to create an invoice for several jobs done for a single client \n  Because I want to get paid\n\n  Scenario: [I.C.1] Create one invoice for an existing workorder\n    Given [I.C.1] a client registered with a vehicle and one finished workorder\n    When [I.C.1] I create an invoice for the workorders\n    Then [I.C.1] an invoice is created\n    And [I.C.1] the workorder is marked as INVOICED\n\n  Scenario: [I.C.2] Create one invoice for multiple existing workorders\n    Given [I.C.2] a client registered with a vehicle and a list of several finished workorders\n    When [I.C.2] I create an invoice for the workorders\n    Then [I.C.2] an invoice is created\n    And [I.C.2] the workorders are marked as INVOICED\n\n  Scenario: [I.C.3] Trying to create one invoice there is one non existing workorder\n    Given [I.C.3] a client registered with a vehicle and a list of several finished workorders\n    When [I.C.3] I try to create an invoice including one non existent workorder id\n    Then [I.C.3] a business error happens with an explaining message\n\n  Scenario: [I.C.4] Trying to create one invoice there is one workorder ASSIGNED\n    Given [I.C.4] a client registered with a vehicle and a list of several finished workorder\n    And [I.C.4] one ASSIGNED workorder\n    When [I.C.4] I try to create an invoice\n    Then [I.C.4] a business error happens with an explaining message\n\n  Scenario: [I.C.5] Trying to create one invoice there is one workorder OPEN\n    Given [I.C.5] a client registered with a vehicle and a list of several finished workorder\n    And [I.C.5] one OPEN ith null argument\n    When [M.D.5] I try to remove a mechanic with null argument\n    Then [M.D.5] argument is rejected with an explaining message\n\n  Scenario: [M.D.6] Try to delete a mechanic with a contract in force\n    Given [M.D.6] a mechanic with a contract in force\n    When [M.D.6] I try to delete the mechanic\n    Then [M.D.6] a business error happens with an explaining message\n\n  Scenario: [M.D.7] Try to delete a mechanic with a terminated contract\n    Given [M.D.7] a mechanic with a terminated contract\n    When [M.D.7] I try to delete the mechanic\n    Then [M.D.y] a business error happens with an explaining message\n","mediaType":"text\/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"classpath:uo\/ri\/cws\/application\/service\/mechanic\/Delete.feature","feature":{"location":{"line":2,"column":1},"tags":[],"language":"en","keyword":"Feature","name":"[M.D] Delete a mechanic","description":"  As a Manager\n  I want to delete a mechanic in case they have not been used\n  Because we need to keep the system clean","children":[{"scenario":{"location":{"line":7,"column":3},"tags":[],"keyword":"Scenario","name":"[M.D.1] Delete an existing unused mechanic","description":"","steps":[{"location":{"line":8,"column":5},"keyword":"Given ","keywordType":"Context","text":"[M.D.1] a registered mechanic","id":"30bb5ff0-7efd-49a4-acae-b7400c0c1697"},{"location":{"line":9,"column":5},"keyword":"When ","keywordType":"Action","text":"[M.D.1] I remove the mechanic","id":"f8f993f2-6912-4d7b-9770-14c9bd856dad"},{"location":{"line":10,"column":5},"keyword":"Then ","keywordType":"Outcome","text":"[M.D.1] the mechanic no longer exists","id":"1a70957d-f3c8-4261-926b-1c577cc49321"}],"examples":[],"id":"d8065fd0-9460-48cb-860a-e3ae81769802"}},{"scenario":{"location":{"line":12,"column":3},"tags":[],"keyword":"Scenario","name":"[M.D.2] Try to remove a non existing mechanic","description":"","steps":[{"location":{"line":13,"column":5},"keyword":"When ","keywordType":"Actio nt\n    Then [P.D.6] argument is rejected with an explaining message\n    Examples: \n      | dni    |\n      | \"null\" |\n      | \"\"     |\n      | \"   \"  |","mediaType":"text\/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"classpath:uo\/ri\/cws\/application\/service\/payroll\/DeleteLastMonthPayrollForMechanic.feature","feature":{"location":{"line":1,"column":1},"tags":[],"language":"en","keyword":"Feature","name":"[P.D] Delete previous month payroll for a mechanic","description":"  As a Manager\n  I want to delete previous month payroll for a mechanic\n  because, sometimes, payrolls are generated with errors","children":[{"scenario":{"location":{"line":6,"column":3},"tags":[],"keyword":"Scenario","name":"[P.D.1] Delete previous month payroll for a mechanic with no payroll","description":"","steps":[{"location":{"line":7,"column":5},"keyword":"Given ","keywordType":"Context","text":"[P.D.1] a mechanic with a contract in force but still no payrolls","id":"c14fcd75-6ca2-41ae-ae7f-3f6d4fc90962"},{"location":{"line":8,"column":5},"keyword":"When ","keywordType":"Action","text":"[P.D.1] I delete previous month payroll for that mechanic","id":"88869408-9d33-40da-9a97-aa6a3c55c2ff"},{"location":{"line":9,"column":5},"keyword":"Then ","keywordType":"Outcome","text":"[P.D.1] no payroll is deleted","id":"9b5c9e2d-352d-45d8-8018-955789e7b205"}],"examples":[],"id":"57f915e1-d344-425d-8216-1316e9627156"}},{"scenario":{"location":{"line":11,"column":3},"tags":[],"keyword":"Scenario","name":"[P.D.2] Delete previous month payroll for a mechanic with only one payroll","description":"","steps":[{"location":{"line":12,"column":5},"keyword":"Given ","keywordType":"Context","text":"[P.D.2] a mechanic with a contract in force and only one payroll previous month","id":"3d3a0c3a-406e-4374-8b1b-5655f24f5dd5"},{"location":{"line":13,"column":5},"keyword":"When ","keywordType":"Action","text":"[P.D.2] I delete previous month payroll for that mechanic","id":"9e45d787-c0e1-4cc3-bb aries for that mechanic are found\n\n  Scenario: [P.Fs.5] Find payrolls for a mechanic with no payroll\n    Given [P.Fs.5] a mechanic with no payrolls\n    When [P.Fs.5] I search payrolls by that mechanic\n    Then [P.Fs.5] the result is empty\n\n  Scenario: [P.Fs.6] Find payrolls for a non existent mechanic\n    When [P.Fs.6] I try to find payrolls for a non existent mechanic\n    Then [P.Fs.6] a business error happens with an explaining message\n\n  Scenario Outline: [P.Fs.7] Try to find a payroll with invalid mechanic id\n    When [P.Fs.7] I try to find payrolls with an invalid mechanic <id>\n    Then [P.Fs.7] argument is rejected with an explaining message\n    Examples:\n      | id     |\n      | \"null\" |\n      | \"\"     |\n      | \" \"    |\n\n# Find payrolls by professional group\n  Scenario: [P.Fs.8] Find payrolls for a professional group with one payroll\n    Given [P.Fs.8] a payroll from a contract with a professional group\n    When [P.Fs.8] I search payrolls by that professional group\n    Then [P.Fs.8] the right payroll summary for that professional group is found\n\n  Scenario: [P.Fs.9] Find payrolls for a professional group with several payrolls\n  \tGiven [P.Fs.9] some payrolls of some contracts of some professional groups\n    When [P.Fs.9] I search payrolls for one of those professional groups\n    Then [P.Fs.9] all payroll summaries for that professional group are found\n\n  Scenario: [P.Fs.10] Find payrolls for a professional group with no payroll\n    Given [P.Fs.10] a professional group with no payrolls\n    When [P.Fs.10] I search payrolls for that professional group\n    Then [P.Fs.10] the result is empty\n\n  Scenario: [P.Fs.11] Find payrolls for a non existent professional group\n    When [P.Fs.11] I try to find payrolls with a non existent professional group name\n    Then [P.Fs.11] a business error happens with an explaining message\n\n  Scenario Outline: [P.Fs.12] Try to find a payroll with invalid professional group name\n    When [P.Fs.12] I try to find payrolls with invalid professional group <name>\n    Then [P.Fs.12] argument is rejected with an explaining message\n    Examples:\n      | name   |\n      | \"null\" |\n      | \"\"     |\n      | \"   \"  |","mediaType":"text\/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"classpath:uo\/ri\/cws\/application\/service\/payroll\/FindPayrollSummary.feature","feature":{"location":{"line":1,"column":1},"tags":[],"language":"en","keyword":"Feature","name":"[P.Fs] Find payrolls all scenarios","description":"  As a manager I want to find information about payrolls","children":[{"scenario":{"location":{"line":5,"column":3},"tags":[],"keyword":"Scenario","name":"[P.Fs.1] Find payrolls when there is none","description":"","steps":[{"location":{"line":6,"column":5},"keyword":"When ","keywordType":"Action","text":"[P.Fs.1] I search for all payrolls","id":"605ceb3e-e1b4-4366-95a1-20c8c1bb9779"},{"location":{"line":7,"column":5},"keyword":"Then ","keywordType":"Outcome","text":"[P.Fs.1] the result is empty","id":"a84d409a-7881-45e7-b5c8-659ce0c4c491"}],"examples":[],"id":"a8192086-6c92-4433-a8d3-6ba83c9fc10c"}},{"scenario":{"location":{"line":9,"column":3},"tags":[],"keyword":"Scenario","name":"[P.Fs.2] Find payrolls when there are some","description":"","steps":[{"location":{"line":10,"column":5},"keyword":"Given ","keywordType":"Context","text":"[P.Fs.2] several payrolls already created","id":"2c880ead-ceee-406c-8295-2c355d1eedaa"},{"location":{"line":11,"column":5},"keyword":"When ","keywordType":"Action","text":"[P.Fs.2] I search all payrolls","id":"b1be500e-6dcf-47f1-a629-3491b633352d"},{"location":{"line":12,"column":5},"keyword":"Then ","keywordType":"Outcome","text":"[P.Fs.2] all the payroll summaries are returned","id":"135a40c7-7c82-4038-888e-ebb090ea00df"},{"location":{"line":13,"column":8},"keyword":"And ","keywordType":"Conjunction","text":"[P.Fs.2] all the summaries are right","id":"edcb10fb-86a4-4a42-87c1-d96de1aba6af"}],"examples":[  by empty nif\n    Then [W.FnI.5] I get an empty list\n\n  Scenario: [W.FnI.6] Try to find workorders with null argument\n    When [W.FnI.6] I try to find workorders with null nif\n    Then [W.FnI.6] argument is rejected with an explaining message","mediaType":"text\/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"classpath:uo\/ri\/cws\/application\/service\/workorder\/FindNotInvoicedWorkOrdersByClientNif.feature","feature":{"location":{"line":1,"column":1},"tags":[],"language":"en","keyword":"Feature","name":"[W.FnI] Find not yet invoiced workorders for a client by client nif","description":"  As a Cashier\n  I need to find not yet invoiced workorders\n  To generate the invoice","children":[{"scenario":{"location":{"line":6,"column":3},"tags":[],"keyword":"Scenario","name":"[W.FnI.1] Find not invoiced workorders by client nif","description":"","steps":[{"location":{"line":7,"column":5},"keyword":"Given ","keywordType":"Context","text":"[W.FnI.1] a client registered with a vehicle and a list of several finished workorders","id":"d339bb21-33ab-4492-b5e6-5c52cf2ee907"},{"location":{"line":8,"column":5},"keyword":"When ","keywordType":"Action","text":"[W.FnI.1] I search not invoiced workorders by client nif","id":"55561806-11cf-4019-9a72-6b0dc1118f71"},{"location":{"line":9,"column":5},"keyword":"Then ","keywordType":"Outcome","text":"[W.FnI.1] I get only finished workorders","id":"798aeadc-858a-4fb4-abc3-cc2c4aba6869"}],"examples":[],"id":"44732c77-6878-485b-822e-a443d367639a"}},{"scenario":{"location":{"line":11,"column":3},"tags":[],"keyword":"Scenario","name":"[W.FnI.2] Find not invoiced workorders by client nif with no workorders","description":"","steps":[{"location":{"line":12,"column":5},"keyword":"Given ","keywordType":"Context","text":"[W.FnI.2] a client registered","id":"6e644d1b-0660-4fa7-b217-6df6f3be14ec"},{"location":{"line":13,"column":5},"keyword":"When ","keywordType":"Action","text":"[W.FnI.2] I search not invoiced workorders by client nif","i
